import React, { useState, useEffect } from 'react';
import "./main.css";
import Axios from "axios";

function ThreadsTitles() {
  const [list, setList] = useState([]);

  useEffect(() => {
    Axios.get("http://localhost:3000/api/get/threads").then((response) => {
      setList(response.data);
    });
  }, []);

  return (
    <div className="App">
        {list.map((val, index) => {
          return <span key={index}>{val.title}</span>
        })}
    </div>
  )
}
export default ThreadsTitles;
